import React from 'react';
import '../CSS/Question.css'; 

const Question = ({ topic, paragraph, buttonText}) => {
  return (
    <div className="container">
      <div className="box">
        <div className="content">
          <div className="Question_topic">{topic}</div>
          <button className="Unfolding_button">{buttonText}</button>
          <div className="Question_content">{paragraph}</div>
        </div>
      </div>
    </div>
  );
};

export default Question;
